import React from 'react';
import { Link } from 'react-router-dom';

export const Card = () => (
    <div className="card">
        <img src={''} className="card-img-top" alt=""/>
        <div className="card-body">
            <h5 className="card-title">
                React JS
            </h5>
            <Link to={'/profile/' + 'react'} className="btn btn-primary">Открыть</Link>
        </div>
    </div>
)
